    render() {
    return (
        <div>
            <div class='Intro'> 
            <p><br/><br/> <b> About </b></p>
            </div>

        <Container>
        <Row>
           <Col align='left' style={{border: '1px dotted red'}}>
               <h2> programmed by:Nigel Sampath </h2>
               <h2> &nbsp </h2>
           
           </Col> 
        </Row>    
        </Container>            

        </div>
    )
    }





}
